    "The course must have an assigned start date.": "\u0425\u0438\u0447\u044d\u044d\u043b\u0438\u0439\u043d \u044d\u0445\u043b\u044d\u0445 \u04e9\u0434\u04e9\u0440 \u0442\u043e\u0434\u043e\u0440\u0445\u043e\u0439\u043b\u043e\u0433\u0434\u0441\u043e\u043d \u0431\u0430\u0439\u0445 \u0448\u0430\u0430\u0440\u0434\u043b\u0430\u0433\u0430\u0442\u0430\u0439.",
    "The enrollment end date cannot be after the course end date.": "\u0425\u0438\u0447\u044d\u044d\u043b\u0438\u0439\u043d \u0431\u04af\u0440\u0442\u0433\u044d\u043b \u0434\u0443\u0443\u0441\u0430\u0445 \u04e9\u0434\u04e9\u0440 \u0445\u0438\u0447\u044d\u044d\u043b \u0434\u0443\u0443\u0441\u0430\u0445 \u04e9\u0434\u0440\u0438\u0439\u043d \u0434\u0430\u0440\u0430\u0430 \u0431\u0430\u0439\u0436 \u0431\u043e\u043b\u043e\u0445\u0433\u04af\u0439.",
