    "The file must be at least {size} in size.": "\u0424\u0430\u0439\u043b\u044b\u043d \u043d\u044c \u0431\u0430\u0433\u0430\u0434\u0430\u0430 {size} \u0445\u044d\u043c\u0436\u044d\u044d\u044d\u0442\u044d\u0439 \u0431\u0430\u0439\u0445 \u0451\u0441\u0442\u043e\u0439.",
    "The file must be smaller than {size} in size.": "\u0424\u0430\u0439\u043b\u044b\u043d \u0445\u044d\u043c\u0436\u044d\u044d \u043d\u044c {size} \u0445\u044d\u043c\u0436\u044d\u044d\u043d\u044d\u044d\u0441 \u0431\u0430\u0433\u0430 \u0431\u0430\u0439\u0445 \u0451\u0441\u0442\u043e\u0439.",
    "The grading process is still running. Refresh the page to see updates.": "\u0414\u04af\u0433\u043d\u044d\u0445 \u04af\u0439\u043b \u044f\u0432\u0446 \u044f\u0432\u0430\u0433\u0434\u0430\u0436 \u0431\u0430\u0439\u043d\u0430. \u0425\u0443\u0443\u0434\u0441\u0430\u0430 \u0448\u0438\u043d\u044d\u0447\u0438\u043b\u0436 \u0448\u0438\u043d\u044d\u0447\u043b\u044d\u043b\u0442\u0438\u0439\u0433 \u0445\u0430\u0440\u043d\u0430 \u0443\u0443.",
    "The raw error message is:": "\u041c\u0435\u0441\u0441\u0435\u0436\u0438\u0439\u043d \u0430\u043b\u0434\u0430\u0430\u043d\u044b \u0442\u043e\u043e \u0431\u043e\u043b:",
    "There are no posts in this topic yet.": "\u042d\u043d\u044d \u0441\u044d\u0434\u0432\u044d\u044d\u0440 \u0445\u0430\u0440\u0430\u0430\u0445\u0430\u043d \u0431\u0438\u0447\u043b\u044d\u0433 \u043e\u0440\u0443\u0443\u043b\u0430\u0430\u0433\u04af\u0439 \u0431\u0430\u0439\u043d\u0430.",
    "There has been a failure to export to XML at least one component. It is recommended that you go to the edit page and repair the error before attempting another export. Please check that all components on the page are valid and do not display any error messages.": "There has been a failure to export to XML at least one component. It is recommended that you go to the edit page and repair the error before attempting another export. Please check that all components on the page are valid and do not display any error messages.",
    "There has been an error while exporting.": "\u042d\u043a\u0441\u043f\u043e\u0440\u0442 \u0445\u0438\u0439\u0445\u044d\u0434 \u0430\u043b\u0434\u0430\u0430 \u0433\u0430\u0440\u043b\u0430\u0430",
    "There has been an error with your export.": "\u0422\u0430\u043d\u044b \u044d\u043a\u0441\u043f\u043e\u0440\u0442\u043e\u043d\u0434 \u0430\u043b\u0434\u0430\u0430 \u0431\u0430\u0439\u043d\u0430.",
    "There must be at least one group.": "\u042f\u0434\u0430\u0436 \u043d\u044d\u0433 \u0431\u04af\u043b\u044d\u0433 \u0431\u0430\u0439\u0445 \u0451\u0441\u0442\u043e\u0439",
    "There must be one cohort to which students can automatically be assigned.": "\u0421\u0443\u0440\u0430\u043b\u0446\u0430\u0433\u0447\u0438\u0434 \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0430\u0430\u0440 \u043e\u043d\u043e\u043e\u0433\u0434\u043e\u0445 \u043d\u044d\u0433 \u043a\u043e\u0433\u043e\u0440\u0442 \u0431\u0430\u0439\u0445 \u0451\u0441\u0442\u043e\u0439. ",
    "There was an error changing the user's role": "\u0425\u044d\u0440\u044d\u0433\u043b\u044d\u0433\u0447\u0438\u0439\u043d \u044d\u0440\u0445\u0438\u0439\u0433 \u0441\u043e\u043b\u0438\u0445\u043e\u0434 \u0430\u043b\u0434\u0430\u0430 \u0433\u0430\u0440\u0441\u0430\u043d \u0431\u0430\u0439\u043d\u0430.",
    "There was an error during the upload process.": "\u0445\u0443\u0443\u043b\u0436 \u0431\u0430\u0439\u0445 \u04af\u0435\u0434 \u0430\u043b\u0434\u0430\u0430 \u0433\u0430\u0440\u0441\u0430\u043d \u0431\u0430\u0439\u043d\u0430",
    "There was an error while unpacking the file.": "\u0444\u0430\u0439\u043b\u044b\u0433 \u0437\u0430\u0434\u0430\u043b\u0436 \u0431\u0430\u0439\u0445 \u04af\u0435\u0434 \u0430\u043b\u0434\u0430\u0430 \u0433\u0430\u0440\u0441\u0430\u043d \u0431\u0430\u0439\u043d\u0430",
    "There was an error while verifying the file you submitted.": "\u0442\u0430\u043d\u044b \u044f\u0432\u0443\u0443\u043b\u0441\u0430\u043d \u0444\u0430\u0439\u043b\u044b\u0433 \u0431\u0430\u0442\u0430\u043b\u0433\u0430\u0430\u0436\u0443\u0443\u043b\u0436 \u0431\u0430\u0439\u0445 \u04af\u0435\u0434 \u0430\u043b\u0434\u0430\u0430 \u0433\u0430\u0440\u0441\u0430\u043d \u0431\u0430\u0439\u043d\u0430",
    "There was an error with the upload": "\u0424\u0430\u0439\u043b \u0445\u0443\u0443\u043b\u0430\u0445\u0430\u0434 \u0430\u043b\u0434\u0430\u0430 \u0433\u0430\u0440\u043b\u0430\u0430.",
    "There's already another assignment type with this name.": "\u0418\u0436\u0438\u043b \u043d\u044d\u0440\u0442\u044d\u0439 \u04e9\u04e9\u0440 \u0434\u0430\u0430\u043b\u0433\u0430\u0432\u0440\u044b\u043d \u0442\u04e9\u0440\u04e9\u043b \u0430\u043b\u044c \u0445\u044d\u0434\u0438\u0439\u043d \u04af\u04af\u0441\u0441\u044d\u043d \u0431\u0430\u0439\u043d\u0430.",
    "This action cannot be undone.": "\u042d\u043d\u044d \u04af\u0439\u043b\u0434\u043b\u0438\u0439\u0433 \u0431\u0443\u0446\u0430\u0430\u0445 \u0431\u043e\u043b\u043e\u043c\u0436\u0433\u04af\u0439.",
    "This browser cannot play .mp4, .ogg, or .webm files.": "\u042d\u043d\u044d \u0445\u04e9\u0442\u04e9\u0447 .mp4, .ogg \u044d\u0441\u0432\u044d\u043b .webm \u0444\u0430\u0439\u043b\u0443\u0443\u0434\u044b\u0433 \u0442\u043e\u0433\u043b\u0443\u0443\u043b\u0436 \u0447\u0430\u0434\u0430\u0445\u0433\u04af\u0439",
    "This certificate has already been activated and is live. Are you sure you want to continue editing?": "\u042d\u043d\u044d \u0433\u044d\u0440\u0447\u0438\u043b\u0433\u044d\u044d \u0430\u043b\u044c \u0445\u044d\u0434\u0438\u0439\u043d \u0438\u0434\u044d\u0432\u0445\u0436\u0441\u044d\u043d \u0431\u0430\u0439\u043d\u0430. \u0422\u0430 \u04af\u0440\u0433\u044d\u043b\u0436\u043b\u04af\u04af\u043b\u044d\u043d \u0437\u0430\u0441\u0432\u0430\u0440\u043b\u0430\u0445 \u0443\u0443?",
